 INSERT INTO srdb.assessment VALUES('DFO-HERR4VWX-1964-2006-PREFONTAINE', 'DFO', 'HERR4VWX', 'PREFONTAINE', '2008-06-02', '2011-07-27 14:46:32', '1964-2006', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'contact details ', 'The 4VWX stock is divided into four components: Southwestern Nova Scotia and Bay of Fundy, offshore Scotian shelf banks, coastal Nova Scotia and Southwestern New Brunswick. Information on catch and landings can be found in the assessment divided into different tables according to area and type of fishing gear. The two VPA models used ages 4-8 only as ages 2-3 are considered to be non-spawners and ages 9+ are too few in numbers. There is one unknown reference point included in this assessment; it is called "reference value" and it is a biomass of 12 000 metric tons; for more information on this read page 12 of the assessment.', '', 1, 1, 'ADAPT', 'no comments', '../spreadsheets/PREFONTAINE-HERR4VWX-2006-editedRP.xls', '999') ; 
